import React from "react";

class GetContact extends React.Component {

constructor(props) {
  super(props);
     this.user_name = []
     this.message = []
  }

render() {
  return (
      <div className="commentSection">
        <h2 className="userName">{this.user_name}</h2>
        <p className="commentMessage">{this.message}</p>
      </div>
  );
}
}
export default GetContact;
